import React from 'react'
import { BrowserRouter, Switch, Route } from "react-router-dom";
import Generate from './generate';
import Home from './home';
export const Routes  = () => {
    return (
        <BrowserRouter>
            <Switch>
                <Route path="" component={Home} />
                <Route path="/generate" component={Generate} />
            </Switch>
        </BrowserRouter>
    )
}
